      </IonGrid>
      
      {/* <IonButton color='favorite'>View all</IonButton> */}
     
      
      <div className='ann-container' >
        
        {/* image */}
        <img className='announceImg' src={church} />

        {/* content */}
        <div className='announceContent'>
          <h4>Gents Night</h4>
          <h5>Mpumelelo Prayer Meeting</h5>
