        {/* content */}
        <div className='announceContent'>
          <h4>Gents Night</h4>
          <h5>Mpumelelo Prayer Meeting</h5>
          {/* button */}
          <IonButton size='small' color='btn' className='btn'> Set Reminder </IonButton>
        </div>
          
      </div>

      <div className='ann-container' >
        
        {/* image */}
        <img className='announceImg' src={church} />

        {/* content */}
        <div className='announceContent'>
          <h4>Gents Night</h4>
          <h5>Mpumelelo Prayer Meeting</h5>
          {/* button */}
          <IonButton size='small' color='btn' className='btn'> Set Reminder </IonButton>
        </div>
          
      </div>



      </IonContent>

      

    </IonPage>
  );
};

